import './App.css';

import photo from '../../assets/img/myphoto.png';
import data from "../../data.json";

import Default from '../Default';
import Title from '../../components/Title';


function App() {
  return (
    <div className="App">
      <Default />

      <Title
        photo={photo}

        name={data.map((data) => {
          return data.name;
        })}

        intro={data.map((data) => {
          return data.intro;
        })}



      />

      <About
        description={data.map((data) => {
          return data.description;
        })}

      />

    </div>
  );
}

export default App;
